import InputWord from "./components/inputs/input_word";
import Search_button from "./components/buttons/search_button";
import Clear_button from "./components/buttons/clear_button";

function App() {
  return (
    <div className="App">
        <h1>Hello</h1>
        <Search_button/>
        <Clear_button/>
        <InputWord/>
    </div>
  );
}

export default App;
